import React, { Component } from "react";

export class CreateBoard extends Component {
	CreateNewBoard = () => {
		console.log("new board create");
	};
	render() {
		return (
			<>
				<div
					onClick={this.CreateNewBoard}
					className=" bg-gray-300 h-20 w-1/5 inline-block cursor-pointer p-3  m-1 flex items-center justify-center text-gray-400"
				>
					create new board
				</div>

				{/* create board modal */}

				<div className=" bg-blue-500 bg-opacity-90 absolute top-0 h-1/5 w-1/5 flex items-center justify-center ">
                    <input type="text" name="" id="" placeholder="Enter board name" />
					<button className="absolute top-0 right-0 p-10">x</button>
				</div>
			</>
		);
	}
}

export default CreateBoard;
